import food from '../../images/food.jpg'

const AppWindow = ({ name }) => {
    return (
        <>
        <img class = "tile__img" src = "https://s3-us-west-2.amazonaws.com/s.cdpn.io/70390/show-1.jpg" alt = ""  />
        <p>{name}</p>
        </>
    )
}

export default AppWindow
